import React from 'react';
import '../../../../App.css';

const city = (props) => {
        return (
            <div className="card cityCard"
                 onClick={props.click}>
                <h2>{props.city}</h2>
                <p className="temperature">{props.currentTemp} <sup>C</sup></p>
                {/* <p>{props.currentWeather}</p> */}
                <img src="./src/img/pljuskovi.png" alt={props.currentWeather}/>
            </div>

        );
}

export default city;
